<template>
  <div class="dj-table" :class="{'pagination': page, 'empty': !currentData.length, 'dj-table-border': !border}">
    <div class="dj-table-panel" :style="{'max-height': getHeight, 'overflow': 'auto'}" :class="{'fixed': getFixed, 'nowrap': isNowrap|| nowrap}">
      <div v-if="getFixed" class="fixed-header">
        <table ref="tableHead">
          <colgroup>
            <col  v-if="$scopedSlots.expand" style="width: 62px; min-width: 62px;">
            <col v-if="draggable && draghandler" style="width: 62px; min-width: 62px;">
            <col v-if="selection" style="width: 62px; min-width: 62px;">
            <col v-for="(column, index) in columnSlots" :key="index" :style="column.width ? `width: ${column.width}px;min-width: ${column.width}px;` : ''">
          </colgroup>
          <thead>
            <tr>
              <th v-if="$scopedSlots.expand"
              :class="{'fixed-left': columnSlots.length && columnSlots[0].isFixedLeft}"
              :style="columnSlots.length && columnSlots[0].isFixedLeft && `left: ${getFixedDefaultColumn.width - 62}px`"></th>
              <th v-if="draggable && draghandler"
              :class="{'fixed-left': columnSlots.length && columnSlots[0].isFixedLeft}"
              :style="columnSlots.length && columnSlots[0].isFixedLeft && `left: ${getFixedDefaultColumn.width - 62}px`"></th>
              <th v-if="selection"
              :class="{'fixed-left': columnSlots.length && columnSlots[0].isFixedLeft}"
              :style="columnSlots.length && columnSlots[0].isFixedLeft && `left: ${getFixedDefaultColumn.width - 62}px`">
                <dj-checkbox v-model="isCheckAll" :indeterminate="isIndeterminate" @change="checkAll()" :disabled="!getSelectionAll"/>
              </th>
              <th v-for="(column, index) in columnSlots" :key="index"
              :class="{'fixed-left': column.isFixedLeft, 'fixed-right': column.isFixedRight, 'last': column.isFixedLast && (column.isFixedLeft && !isScrollLeft || !isScrollRight && column.isFixedRight), 'word-break': column.wordBreak, 'dj-table-column-has-sort': column.sort}"
              :style="(column.isFixedLeft && `left: ${column.left}px`) || (column.isFixedRight && `right: ${column.right}px`)" @click="column.sort && onSort(column.field)">
                <component v-if="column.isHeaderSlot" :is="cmps[`djTableTh${index}`]"></component>
                <div v-else class="cell">
                  {{column.label}}
                <div v-if="column.sort" class="dj-table-column-sort">
                  <dj-icon icon="turning-top" :class="{'dj-active': sortField == column.field && order == 'asc'}" fontSize="14px"/><br/>
                  <dj-icon icon="turning-bottom" :class="{'dj-active': sortField == column.field && order == 'desc'}" fontSize="14px"/>
                </div>
                </div>
              </th>
            </tr>
          </thead>
        </table>
      </div>
      <table ref="table">
        <colgroup>
          <col v-if="$scopedSlots.expand" style="width: 62px; min-width: 62px;">
          <col v-if="draggable && draghandler" style="width: 62px; min-width: 62px;">
          <col v-if="selection" style="width: 62px; min-width: 62px;">
          <col v-for="(column, index) in columnSlots" :key="index" :style="column.width ? `width: ${column.width}px;min-width: ${column.width}px;` : ''">
        </colgroup>
        <thead v-if="!getFixed">
          <tr>
            <th v-if="$scopedSlots.expand"></th>
            <th v-if="draggable && draghandler"></th>
            <th v-if="selection"><dj-checkbox v-model="isCheckAll" :indeterminate="isIndeterminate" @change="checkAll()" :disabled="!getSelectionAll"/></th>
            <slot name="default"></slot>
          </tr>
        </thead>
        <tbody v-if="!draggable">
          <template v-for="(item, rIndex) in tableData">
            <tableTr :rIndex="rIndex" :key="rIndex" :item="item">
              <component :is="cmps[`djTableTd${scope.cIndex}`]" :scope="item" slot-scope="scope"></component>
            </tableTr>
            <tr v-if="item && item.showExpand && $scopedSlots.expand" :key="'expand' + rIndex" class="expand"><td :colspan="columnSlots.length + getFixedDefaultColumn.count"><slot name="expand" v-bind="item"></slot></td></tr>
          </template>
        </tbody>
        <draggable  v-else v-model="tableData" :options="{disabled: !draggable, handle: draghandler ? '.drag-handle' : ''}" tag="tbody" @end="draggableEnd()">
          <template v-for="(item, rIndex) in tableData">
            <tableTr :rIndex="rIndex" :key="rIndex" :item="item">
              <component :is="cmps[`djTableTd${scope.cIndex}`]" :scope="item" slot-scope="scope"></component>
            </tableTr>
            <!-- <tr :key="rIndex" class="dj-table-row" :class="{'success': (selection || selectionRow) && isCheck(item.row), 'selection-row': selectionRow, 'striped': striped && rIndex % 2 == 1}" @click="handEvent('rowClick', item, $event)">
              <td v-if="$scopedSlots.expand"
              :class="{'fixed-left': columnSlots.length && columnSlots[0].isFixedLeft}"
              :style="columnSlots.length && columnSlots[0].isFixedLeft && `left: 0px`">
                <i class="iconfont" :class="{'arrow-right': !item.showExpand, 'arrow-bottom': item.showExpand}" @click="item.showExpand = !item.showExpand"></i>
              </td>
              <td v-if="draggable && draghandler"
              :class="{'fixed-left': columnSlots.length && columnSlots[0].isFixedLeft}"
              :style="columnSlots.length && columnSlots[0].isFixedLeft && `left: 0px`">
                <i class="iconfont sort1 drag-handle"></i>
              </td>
              <td v-if="selection"
              :class="{'fixed-left': columnSlots.length && columnSlots[0].isFixedLeft}"
              :style="columnSlots.length && columnSlots[0].isFixedLeft && `left: ${getFixedDefaultColumn.width - 37}px`">
                <dj-checkbox :checked="isCheck(item.row)" @change="onCheck(item.row)"/>
              </td>
              <td v-for="(column, cIndex) in columnSlots" :key="cIndex"
              :class="{'fixed-left': column.isFixedLeft, 'fixed-right': column.isFixedRight, 'last': column.isFixedLast && (column.isFixedLeft && !isScrollLeft || !isScrollRight && column.isFixedRight), 'word-break': column.wordBreak}"
              :style="((column.isFixedLeft && `left: ${column.left}px;`) || (column.isFixedRight && `right: ${column.right}px;`) || '') + (column.width ? 'white-space: none;' : '')">
                <div class="cell">
                  <span v-if="cIndex == 0" v-for="indent in item.level" :key="indent" class="indent"></span>
                  <span  v-if="cIndex == 0 && isTree && (item.row[tree.children] && item.row[tree.children].length > 0 || item.row[tree.hasChildren] === true)">
                    <i v-if="item.loading" class="iconfont load" style="font-size: 20px;"></i>
                    <dj-button v-else @click="onTree(item, rIndex)" fontSize="12px" style="height: 20px; width: 20px; padding: 0px;" :icon="!item.showChildren ? 'add' : 'subtract'"></dj-button>
                  </span>
                  <component v-if="column.isBodySlot" :is="cmps[`djTableTd${cIndex}`]" :scope="item"></component>
                  <template v-else>{{item.row[column.field]}}</template>
                </div>
              </td>
            </tr> -->
          </template>
        </draggable>
      </table>
    </div>
    <div v-if="!currentData.length" class="table-empty" :style="getEmptyHeight ? `height: ${getEmptyHeight};` : ''">
      <slot name="empty">
        <div>
          <img src="data:image/png;base64," alt="" width="120px"/>
          <div class="empty-desc"></div>
        </div>
      </slot>
    </div>
    <div v-if="page" class="table-tfoot">
      <table>
        <tfoot>
          <tr>
            <th :colspan="columnSlots.length + getFixedDefaultColumn.count" style="text-align: right;">
              <div class="pagination-panel"><dj-pagination
                :total="page.totalCount"
                :pageSize="page.pageSize"
                :currentPage="page.pageNo"
                :pageSizes="page.pageSizes"
                @current-change="setPageNo"
              ></dj-pagination>
              </div>
            </th>
            </tr>
        </tfoot>
      </table>
    </div>
  </div>
</template>

<script>
// import { on } from '@/utils/dom';
// import Vue from 'vue';
import pagination from './mixins/pagination';
import check from './mixins/check';
import loading from '@/mixins/loading';
import tree from './mixins/tree';
import sort from '../../table/src/mixins/sort';
import draggable from 'vuedraggable';
import tableTr from './tableTr';

export default {
  name: 'djTable',
  mixins: [check, pagination, loading, tree, sort],
  components: {
    draggable,
    tableTr
  },
  props: {
    selectionDisabled: Function,
    value: Array,
    data: {
      type: Array,
      default: () => {}
    },
    page: Object,
    selection: Boolean,
    selectionType: {
      type: String,
      default: 'checkbox' // radio
    },
    selectionCount: {
      type: Number
    },
    selectionAll: {
      type: Boolean,
      default: true
    },
    selectionRow: Boolean,
    loading: Boolean,
    height: [Number, String],
    draggable: {
      type: Boolean,
      default: false
    },
    draghandler: Boolean,
    tree: {
      type: Object
    },
    nowrap: {
      type: Boolean,
      default: false
    },
    striped: {
      type: Boolean,
      default: false
    },
    emptyHeight: [Number, String],
    expandTreeAll: {
      type: Boolean,
      default: false
    },
    border: {
      type: Boolean,
      default: true
    }
  },
  data() {
    return {
      currentData: this.value || this.data || [],
      tableData: [],
      columnSlots: [],
      defaultColumnSlots: [],
      isScrollLeft: true,
      isScrollRight: false,
      cmps: {},
      isNowrap: true,
      sortField: ''
    };
  },
  computed: {
    getFixed() {
      return this.height || this.columnSlots.find(column => column.fixed === '' || column.fixed);
    },
    getFixedDefaultColumn() {
      let count = 0;
      let width = 0;
      if (this.$scopedSlots.expand) {
        count++;
        width += 62;
      }
      if (this.draggable && this.draghandler) {
        count++;
        width += 62;
      }
      if (this.selection) {
        count++;
        width += 62;
      }
      return {count, width};
    },
    isTree() {
      return this.tree && this.tree.children;
    },
    getHeight() {
      return typeof this.height == 'number' ? this.height + 'px' : this.height;
    },
    getEmptyHeight() {
      return typeof this.emptyHeight == 'number' ? this.emptyHeight + 'px' : this.emptyHeight;
    },
    getSelectionAll() {
      if (this.selectionCount) {
        if (this.selectionCount < this.checkList.length) {
          return false;
        }
        if (this.selectionCount < this.tableData.length) {
          return false;
        }
        if (this.selectionCount < this.tableData.filter(item => !this.isCheck(item.row)).length + this.checkList.length) {
          return false;
        }
      }
      return this.selectionAll;
    },
    getSelectionDisabled() {
      if (this.selectionCount > 1 && this.selectionCount <= this.checkList.length) {
        return true;
      }
      return false;
    }
  },
  watch: {
    loading: function(n, o) {
      this.initLoading();
    },
    value: {
      handler: function(n, o) {
        this.currentData = this.value,
        this.initData();
        this.fixed();
      },
      deep: true
    },
    data: {
      handler: function(n, o) {
        this.currentData = this.data;
        this.initData();
        this.fixed();
      },
      deep: true
    },
    tableData: {
      handler: function(n, o) {
        this.$emit('input', this.tableData.filter(item => item && item.level == 0).map(item => item.row));
      },
      deep: true
    }
  },
  created() {
    this.init();
    this.initData();
  },
  mounted() {
    this.initLoading();
    this.fixed();
    this.onScroll();
  },
  updated() {
    let length = this.$slots.default && this.$slots.default.filter(item => item.tag).length || 0;
    if (length != this.columnSlots.length) {
      this.init();
    }
  },
  methods: {
    getData() {
      return this.tableData.filter(item => item && item.level == 0).map(item => item.row);
    },
    init() {
      let vNodes = [];
      let columnSlots = [];
      // dj-table-column
      this.$slots.default && this.$slots.default.forEach((vNode, index) => {
        if (vNode.componentOptions && vNode.componentOptions.tag == 'dj-table-column') {
          vNodes.push(vNode);
        }
      });
      // 
      vNodes.forEach((vNode, index) => {
        if (vNode.componentOptions && vNode.componentOptions.tag == 'dj-table-column') {
          let columnSlot = vNode.componentOptions.propsData || {};
          columnSlot.sort = columnSlot.sort !== false && columnSlot.sort !== void 0;
          columnSlot.isHeaderSlot = false;
          columnSlot.isBodySlot = false;
          if (vNode.componentOptions.children) {
            columnSlot.headerSlots = vNode.componentOptions.children.find(child => child.data && child.data.slot == 'header');
            if (columnSlot.headerSlots) {
              columnSlot.isHeaderSlot = true;
              this.cmps[`djTableTh${index}`] = {
                render: function(createElement) {
                  return createElement('div', {class: 'cell'}, columnSlot.headerSlots.children);
                }
              };
              // Vue.component(`djTableTh${index}`, {
              //   render: function(createElement) {
              //     return createElement('div', {class: 'cell'}, columnSlot.headerSlots.children);
              //   }
              // });
            }
          }
          if (vNode.data && vNode.data.scopedSlots) {
            if (vNode.data.scopedSlots.header) {
              columnSlot.headerSlots = vNode.data.scopedSlots.header;
              columnSlot.isHeaderSlot = true;
              this.cmps[`djTableTh${index}`] = {
                props: {
                  scope: Object
                },
                render: function(createElement) {
                  return createElement('div', {class: 'cell'}, columnSlot.headerSlots.default(this.scope));
                }
              };
              // Vue.component(`djTableTh${index}`, {
              //   props: {
              //     scope: Object
              //   },
              //   render: function(createElement) {
              //     return createElement('div', {class: 'cell'}, columnSlot.headerSlots.default(this.scope));
              //   }
              // });
            }
            if (vNode.data.scopedSlots.default) {
              columnSlot.bodySlots = vNode.data.scopedSlots;
              columnSlot.isBodySlot = true;
              this.cmps[`djTableTd${index}`] = {
                props: {
                  scope: Object
                },
                render: function(createElement) {
                  return createElement('div', {class: 'cell'}, columnSlot.bodySlots.default(this.scope));
                  // return columnSlot.bodySlots.default(this.scope);
                }
              };
              // Vue.component(`djTableTd${index}`, {
              //   props: {
              //     scope: Object
              //   },
              //   render: function(createElement) {
              //     return createElement('div', {class: 'cell'}, columnSlot.bodySlots.default(this.scope));
              //   }
              // });
            }
          }
          columnSlots.push(columnSlot);
        }
      });
      this.columnSlots = columnSlots;
      this.defaultColumnSlots = columnSlots.map(cs => {
        return {...cs};
      });
      this._children = vNodes;
      this.$slots.default = vNodes;
    },
    async initData() {
      this.isNowrap = true;
      let currentData = this.value || this.data || [];
      if (JSON.stringify(this.tableData.filter(item => item && item.level == 0).map(item => item.row)) == JSON.stringify(currentData)) {
        if (this.isTree) {
          // fix: 
          if (this.expandTreeAll) {
            this.tableData.forEach(item => {
              item.showExpand = this.expandTreeAll;
              item.showChildren = this.expandTreeAll;
            });
          }

          this.refreshTree();
        }
        return false;
      }
      let newData = currentData.map((item, index) => {
        return {index: index, row: item, parent: currentData, level: 0, showChildren: false, loading: false, showExpand: false};
      });
      if (this.isTree) {
        let treeData = [].concat(this.tableData || []);
        this.tableData = newData;
        treeData.filter(item => item && item.showChildren).forEach(item => {
          let row = newData.find(item1 => item1.row == item.row);
          if (row) {
            this.onTree(row);
          }
        });
      } else {
        this.tableData = newData;
      }
    },
    initLoading() {
      if (this.loading) {
        this.showLoading({white: true});
      } else {
        this.closeLoading();
      }
    },
    fixed() {
      this.columnSlots = this.defaultColumnSlots.map(cs => {
        return {...cs};
      });
      this.$nextTick(() => {
        this.isNowrap = false;
        if (!this.getFixed) {
          return;
        }
        let leftIndex = 0;
        let rightIndex = 0;
        let left = this.getFixedDefaultColumn.width;
        this.columnSlots.forEach((column, index) => {
          if (!column.width) {
            column.width = this.$refs.table?.querySelectorAll('tr > td')[index + this.getFixedDefaultColumn.count]?.offsetWidth || 0;
            let contentWidth = this.$refs.tableHead?.querySelectorAll('tr > th')[index + this.getFixedDefaultColumn.count]?.querySelector('.cell')?.offsetWidth || this.$refs.table?.querySelectorAll('tr > th')[index + this.getFixedDefaultColumn.count]?.querySelector('.cell')?.offsetWidth;

            this.$refs.table?.querySelectorAll('tr').forEach(item => {
              let tempWidth = item?.querySelectorAll('td')[index + this.getFixedDefaultColumn.count]?.querySelector('.cell').offsetWidth;
              contentWidth = tempWidth > contentWidth ? tempWidth : contentWidth;
            });

            if (contentWidth > column.width) {
              column.width = contentWidth;
            }
            column.width = column.width + 30;
          }

          column.left = left;
          left += column.width;
          if ((column.fixed === '' || column.fixed) && leftIndex == index) {
            leftIndex++;
            column.isFixedLeft = true;
          } else if (column.fixed === '' || column.fixed){
            rightIndex++;
          } else if (rightIndex > 0){
            rightIndex--;
          }
        });
        let right = 0;
        rightIndex = 0;
        [].concat(this.columnSlots).reverse().forEach((column, index) => {
          column.right = right;
          right += column.width;
          if ((column.fixed === '' || column.fixed) && rightIndex == index) {
            rightIndex++;
            column.isFixedRight = true;
          }
        });
        leftIndex && ([].concat(this.columnSlots).reverse().find(column => column.isFixedLeft).isFixedLast = true);
        rightIndex && (this.columnSlots.find(column => column.isFixedRight).isFixedLast = true);

        this.columnSlots = [].concat(this.columnSlots);
      });
    },
    onScroll() {
      if (!this.getFixed) {
        return false;
      }
      let tablePanel = this.$el.querySelector('.dj-table-panel');

      let scroll = () => {
        this.isScrollLeft = tablePanel.scrollLeft === 0;
        this.isScrollRight = tablePanel.scrollWidth - tablePanel.scrollLeft === tablePanel.clientWidth;
      };

      tablePanel.onscroll = scroll;
    },
    draggableEnd() {
      this.tableData = this.tableData.filter(item => item);
      this.$emit('dragend', this.getData());
    },
    handEvent(type, item, event) {
      if (type === 'rowClick') {
        this.selectionRow && this.onCheck(item.row);
      }
      if (type === 'expandChange') {
        this.$emit(type, item.showExpand, item.row, event);
        return;
      }
      this.$emit(type, item.row, event);
    },
    sortChange(order) {
      this.sortField = order.field;
      this.$emit('sortChange', order);
    }
  }
};
</script>

<style lang="less" scoped>
</style>
